===Etymology===
From {{etyl|enm|en}} {{term|at|lang=enm}}, from {{etyl|ang|en}} {{term|æt||at, near, by, toward|sc=unicode|lang=ang}}, from {{etyl|gem-pro|en}} {{term/t|gem-pro|*at||at, near, to}}, from {{etyl|ine-pro|en}} {{term/t|ine-pro|*ád||near, at}}. Cognate with {{etyl|sco|-}} {{term|at||at|lang=sco}}, {{etyl|frr|-}} {{term|äät|lang=frr}}, {{term|äit|lang=frr}}, {{term|et|lang=frr}}, {{term|it||at|lang=frr}}, {{etyl|da|-}} {{term|at||to|lang=da}}, {{etyl|fo|-}} {{term|at||at, to, toward|lang=fo}}, {{etyl|no|-}} {{term|åt||to|lang=no}}, {{etyl|sv|-}} {{term|åt||for, toward|lang=sv}}, {{etyl|is|-}} {{term|að||to, towards|lang=is}}, {{etyl|got|-}} {{term|𐌰𐍄||at|tr=at|lang=got}}, {{etyl|la|-}} {{term|ad||to , near|lang=la}}.

