===Preposition===
{{en-prep}}

# [[in|In]] or very [[near]] a particular [[place]].
#* {{RQ:Schuster Hepaticae V|4}}
#*: (''b'')  sporophyte with foot reduced, the entire sporophyte enveloped by the calyptra, which is ± stipitate '''at''' the base.
#: '''''At''' that precise position, '''at''' Jim’s house.''
# {{qualifier|indicating time}} [[simultaneous|Simultaneous]], [[during]].
#* {{quote-news
|year=2012
|date=April 19
|author=Josh Halliday
|title=Free speech haven or lawless cesspool – can the internet be civilised?
|work=the Guardian
|url=http://www.guardian.co.uk/technology/2012/apr/19/free-speech-haven-lawless-cesspool
|page=
|passage=Other global taboos, such as sex and suicide, manifest themselves widely online, with websites offering suicide guides and Hot XXX Action seconds away '''at''' the click of a button. The UK government will come under pressure to block access to pornographic websites this year when a committee of MPs publishes its report on protecting children online.}}
#: '''''At''' six o’clock, '''at''' closing time, '''at''' night.''
# In the [[direction]] of (often in an unfocused or uncaring manner).
#: ''He threw the ball '''at''' me, he shouted '''at''' her.''
# [[occupy|Occupied]] in (activity).
#: ''Men '''at''' work.''
# {{non-gloss definition|Indicates a position on a scale or in a series.}}
#: ''Sell '''at''' 90.''
#: ''Tiger finished the round '''at''' tenth, seven strokes behind the leaders.''
#: ''I'm offering it - just to select customers - '''at''' cost.''
# Because of.
#: ''Laugh '''at''' a joke.''
# Holding a given [[speed]] or [[rate#English|rate]].
#: ''It is growing '''at''' the rate of 3% a year.''
#: ''Cruising along '''at''' fifty miles per hour.''
# In a state of.
#: ''She is [[at sixes and sevens|'''at''' sixes and sevens]] with him.''
#: ''They are [[at loggerheads|'''at''' loggerheads]] over how best to tackle the fiscal cliff.''
#: ''The city was [[at the mercy of|'''at''' the mercy of]] the occupying forces.''


====Usage notes====
* ''He threw the ball to me'' &mdash; (so I could catch it).
* ''He threw the ball at me'' &mdash; (trying to hit me with it).

* ''He talked to her'' &mdash; (conversationally).
* ''He shouted at her'' &mdash; (aggressively).

